import React, { useState, useMemo } from 'react';
import useProfileStore from '../../stores/profileStore';
import useNicheStore from '../../stores/nicheStore';
import Table from '../../components/common/Table';
import Button from '../../components/common/Button';
import './ProfileList.scss';

function ProfileList() {
  const {
    profiles,
    updateProfile,
    deleteProfiles,
    setFilters,
    getFilteredProfiles
  } = useProfileStore();

  const { selectedNicheId } = useNicheStore();

  const [selectedIds, setSelectedIds] = useState(new Set());
  const [statusFilter, setStatusFilter] = useState('all');
  const [sortColumn, setSortColumn] = useState(null);
  const [sortDirection, setSortDirection] = useState(null);

  // For development, initialize with some sample data
  React.useEffect(() => {
    if (profiles.length === 0) {
      useProfileStore.setState({
        profiles: [
          {
            id: 1,
            username: 'fitness_guru',
            status: 'active',
            lastChecked: new Date().toISOString(),
            nicheId: 1
          },
          {
            id: 2,
            username: 'fashion_trends',
            status: 'active',
            lastChecked: new Date().toISOString(),
            nicheId: 2
          },
          {
            id: 3,
            username: 'foodie_adventures',
            status: 'inactive',
            lastChecked: new Date().toISOString(),
            nicheId: 3
          }
        ]
      });
    }
  }, [profiles.length]);

  // Update filters when niche selection changes
  React.useEffect(() => {
    setFilters({ nicheId: selectedNicheId });
  }, [selectedNicheId, setFilters]);

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      month: 'short',
      day: 'numeric',
      year: 'numeric'
    });
  };

  const filteredProfiles = useMemo(() => {
    const profiles = getFilteredProfiles();
    if (statusFilter === 'all') return profiles;
    return profiles.filter(profile => profile.status === statusFilter);
  }, [getFilteredProfiles, statusFilter]);

  const handleSort = (key, direction) => {
    setSortColumn(key);
    setSortDirection(direction);
    // TODO: Implement sorting in store
  };

  const handleStatusClick = (id, currentStatus) => {
    const newStatus = currentStatus === 'active' ? 'inactive' : 'active';
    updateProfile(id, { status: newStatus });
  };

  const handleSelectAll = (checked) => {
    if (checked) {
      setSelectedIds(new Set(filteredProfiles.map(p => p.id)));
    } else {
      setSelectedIds(new Set());
    }
  };

  const handleSelectOne = (id, checked) => {
    const newSelected = new Set(selectedIds);
    if (checked) {
      newSelected.add(id);
    } else {
      newSelected.delete(id);
    }
    setSelectedIds(newSelected);
  };

  const handleDelete = (id) => {
    deleteProfiles([id]);
  };

  const { niches } = useNicheStore();

  const handleAssignNiche = (profileId, nicheId) => {
    updateProfile(profileId, { nicheId });
  };

  const handleBulkDelete = () => {
    if (selectedIds.size > 0) {
      deleteProfiles(Array.from(selectedIds));
      setSelectedIds(new Set());
    }
  };

  const columns = [
    {
      key: 'select',
      title: (
        <input
          type="checkbox"
          data-testid="select-all"
          checked={selectedIds.size === filteredProfiles.length}
          onChange={(e) => handleSelectAll(e.target.checked)}
        />
      ),
      render: (profile) => (
        <input
          type="checkbox"
          data-testid="profile-checkbox"
          checked={selectedIds.has(profile.id)}
          onChange={(e) => handleSelectOne(profile.id, e.target.checked)}
        />
      )
    },
    {
      key: 'url',
      title: 'Instagram URL',
      sortable: true,
      render: (profile) => (
        <a 
          href={`https://instagram.com/${profile.username}`}
          target="_blank"
          rel="noopener noreferrer"
        >
          {`instagram.com/${profile.username}`}
        </a>
      )
    },
    {
      key: 'username',
      title: 'Username',
      sortable: true
    },
    {
      key: 'lastChecked',
      title: 'Date Last Checked',
      sortable: true,
      render: (profile) => formatDate(profile.lastChecked)
    },
    {
      key: 'lastDetected',
      title: 'Date Last Detected',
      sortable: true,
      render: (profile) => profile.lastDetected ? formatDate(profile.lastDetected) : '-'
    },
    {
      key: 'totalChecks',
      title: 'Total Checks',
      sortable: true,
      render: (profile) => profile.totalChecks || 0
    },
    {
      key: 'totalDetections',
      title: 'Total Detections',
      sortable: true,
      render: (profile) => profile.totalDetections || 0
    },
    {
      key: 'actions',
      title: 'Actions',
      render: (profile) => (
        <div className="profile-list__actions">
          <select
            value={profile.nicheId || ''}
            onChange={(e) => handleAssignNiche(profile.id, e.target.value)}
            className="profile-list__niche-select"
          >
            <option value="">Select Niche</option>
            {niches.map(niche => (
              <option key={niche.id} value={niche.id}>
                {niche.name}
              </option>
            ))}
          </select>
          <Button
            variant="danger"
            size="small"
            onClick={() => handleDelete(profile.id)}
            data-testid="delete-button"
          >
            Delete
          </Button>
        </div>
      )
    }
  ];

  if (!filteredProfiles.length) {
    return (
      <div className="profile-list profile-list--empty">
        <p>No profiles found</p>
      </div>
    );
  }

  return (
    <div className="profile-list">
      <div className="profile-list__header">
        <div className="profile-list__filters">
          <select
            className="profile-list__filter"
            data-testid="status-filter"
            value={statusFilter}
            onChange={(e) => setStatusFilter(e.target.value)}
          >
            <option value="all">All Status</option>
            <option value="active">Active</option>
            <option value="inactive">Inactive</option>
          </select>
        </div>
        <div className="profile-list__actions">
          {selectedIds.size > 0 && (
            <Button
              variant="danger"
              onClick={handleBulkDelete}
              data-testid="bulk-delete-button"
            >
              Delete Selected ({selectedIds.size})
            </Button>
          )}
        </div>
      </div>

      <Table
        data={filteredProfiles}
        columns={columns}
        onSort={handleSort}
        sortColumn={sortColumn}
        sortDirection={sortDirection}
      />
    </div>
  );
}

export default ProfileList;
